            lightcouldR = document.getElementById("lightcouldR"),
            lightcouldL = document.getElementById("lightcouldL"),
            stardark = document.getElementById("star-dark"),
            spider = document.getElementById("spider"),
            bat1 = document.getElementById("bat1"),
            bat2 = document.getElementById("bat2"),
            title = document.getElementById("title");
        
        var tl1 = new TimelineLite();
        var tl2 = new TimelineLite();
        var tsd = new TimelineMax({repeat: -1});
        var tsb = new TimelineMax({repeat: -1});
        var tl3 = new TimelineLite();
        var tl4 = new TimelineLite();
        
        tl1
            .add('darkcouldL')
            .from(darkcouldL, 1, {opacity:100 , ease: Circ.easeOut, x: -500, autoAlpha:0 })
            .from(lightcouldL, 1, {opacity:100 , ease: Circ.easeOut, x: -500, autoAlpha:0 }, 'darkcouldL')
            .add('darkcouldR')
            .from(darkcouldR, 1, {opacity:100 , ease: Circ.easeOut, x: 40, autoAlpha:0 })
            .from(lightcouldR, 1, {opacity:100 , ease: Circ.easeOut, x: 40, autoAlpha:0 }, 'darkcouldR')
//            .add('bat2')
//            .from(bat2, 1, {opacity:0})
//            .from(bat1, 1, {opacity:0}, 'bat2')
//            .from(sherry, 1, {opacity:100, x: -300, autoAlpha:0, ease:Power1.easeIn})
//            .from(trotro, 1.5, {opacity:100 , y: -1000, autoAlpha:0, ease:Power1.easeOut})
            .from(blackflat, 1, {opacity:100 , y: -100, autoAlpha:0, ease:Power1.easeOut});
        
        TweenLite.fromTo(moon, 1, {opacity:100 }, {opacity:0.8 });
//        TweenLite.fromTo(title, 3, {opacity:100 }, {opacity:0 });
//        TweenLite.fromTo(spider, 3, {opacity:100 }, {opacity:0 });
        
        tl2
            .from(spider, 2, {y: 15})
